import React from 'react';
import { Layout } from './layout/Layout.js';

function Newsletter() {
  return (
    <Layout>
      <div className="text-block-left small">
        <p>✨ I'm kicking off something new – a newsletter!</p>
        <p>You'll find the content for my newsletter in blog form here a few days after I've sent it out.</p>
        <p>Now I'm not making any promises on newsletter frequency (or whether the content will solely be technical), but I hope you'll subscribe nonetheless.</p>
      </div>
    </Layout>
  );
}

export default Newsletter;
